    "# Ensure 'ds' column is in datetime format\n",
    "forecast['ds'] = pd.to_datetime(forecast['ds'], errors='coerce')\n",
    "\n",
    "# Filter the forecast to only include dates after October 10, 2024\n",
    "future_forecast = forecast[forecast['ds'] > '2024-10-10']\n",
    "\n",
    "# Resample the data to weekly frequency, summing the daily predicted counts ('yhat')\n",
    "weekly_future_forecast = future_forecast.resample('W-Mon', on='ds').agg({'yhat': 'sum'}).reset_index()\n",
    "\n",
    "# Rename 'yhat' column to 'predicted_count' for better readability\n",
    "weekly_future_forecast = weekly_future_forecast.rename(columns={'yhat': 'predicted_count'})\n",
    "\n",
    "# Display the weekly forecast values\n",
    "print(weekly_future_forecast[['ds', 'predicted_count']])\n"
